..', 'verbe', 'cf. commentaire', 'schibetta, schibettas', 'trer schibettas', 'trer schibettas', 'trer schibetas', 'trer schibetas', 'trer schebas', 'trer schebas', 'tir a schaibgias', 'tir a schaibgias', 'tir a schaibgias', 'tir a schaibgias', 'Coutumes des Grisons:\nle lancer de \"schibettas\" (petits disques en bois) était jadis répandu en Suisse. On pense que cette coutume était liée au culte de la fertilité. Quelques villages le pratiquent encore, dont Dardin, Danis et Tavanasa, en Surselva.\nLe samedi suivant le Mercredi des Cendres, à la nuit tombée, les jeunes hommes montent au-dessus du village et allument un grand feu. Ils y chauffent au rouge de petits disques en bois d\'orme (les fameuses \"schibettas\") que l\'on pourrait comparer aux frisbees d\'aujourd\'hui, mais de plus petite taille et avec un trou en leur milieu. Les \"schibettas\", une fois brûlantes, sont retirées du feu et lancées à l\'aide de fins bâtons, pouvant couvrir une distance considérable. Chaque \"schibetta\" lancée est dédiée à l\'une des jeunes femmes du village, dont le nom est crié par le tireur. Pendant ce temps, les jeunes femmes confectionnent de grands biscuits, les \"patlaunas\", réservés à cette occasion, qu\'elles partageront avec les hommes après leur retour.', '', '', '', '', 6613),
